import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import PageComponent from 'src/PageComponent.js'
import './Css/App.css'
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Page/>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
